A blind boy receives a vision that warns him of the birth of the anti-christ.

Obscure Italian occult giallo gem. Mark is a blind boy living with his sister Christine in Venice. During a funeral Mark has another in a series of recent visions of a man with a cane, only this time the man is with a woman and a dog that is eating a decayed arm. Christine is openly unsympathetic to these visions and resents having to look after her brother.


